import React from 'react'
import PizzaStatusDisplay from '../components/PizzaStatusDisplay'
import Wrapper from '../components/Wrapper'

const Admin = () => {
	return (
		<Wrapper>
			<PizzaStatusDisplay isAdmin={true} />
		</Wrapper>
	)
}

export default Admin
